import React, {useState} from 'react';
import Box from '@mui/material/Box'
import Button from "@mui/material/Button"
import { TextField } from '@mui/material';
import Card from '@mui/material/Card';




export default function LogInForm() {


    const [credential, setCredential] = useState({
        user_email: "",
        user_password: "",
    });




  return (
    <div>
      <Card sx={{ maxWidth: 410, height: 210 }}>
        <Box sx={{ width: 390, height: 200, border: "primary dark" }}>
          <form method="POST" action="/authentication">
            <TextField
              onChange={(e) =>
                setCredential({ ...credential, user_email: e.target.value })
              }
              id="outlined-basic"
              fullWidth
              label="Email address"
              margin="none"
              variant="outlined"
            ></TextField>
            <br />
            <TextField
              onChange={(e) =>
                setCredential({
                  ...credential,
                  user_password: e.target.value,
                })
              }
              id="outlined-basic"
              fullWidth
              label="Password"
              margin="dense"
              variant="outlined"
            ></TextField>
            <br />
            <Button onSubmit={handledSubmit} type="submit" variant="contained">
              Log In
            </Button>
          </form>
        </Box>
      </Card>
    </div>
  );
}
